// SPDX-License-Identifier: MIT
pragma solidity >=0.8.17;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "./ISafeVault.sol";

/// @title  ISafeToken
/// @author crypt0grapher
/// @notice This contract is used as a token
interface ISafeToken is IERC20, IERC20Metadata {

    /**
    *   @notice buy SAFE tokens for given amount of USD, taxes deducted from the provided amount, SAFE is minted
    *   @param _usdToSpend number of tokens to buy, the respective amount of USD will be deducted from the user, Safe Yield token will be minted
    */
    function buySafeForExactAmountOfUSD(uint256 _usdToSpend) external returns (uint256);

    /**
    *   @notice calculate and deduct amount of USD needed to buy given amount of SAFE tokens, SAFE is minted
    *   @param _safeTokensToBuy number of tokens to buy, the respective amount of stable coin  will be deducted from the user, Safe Yield token will be minted
    */
    function buyExactAmountOfSafe(uint256 _safeTokensToBuy) external;

    /**
    *   @notice sell given amount of SAFE tokens for USD, taxes deducted from the user, SAFE is burned
    *   @param _safeTokensToSell number of tokens to sell, the respective amount of stable coin  will be returned from the user, Safe Yield token will be burned
    */
    function sellExactAmountOfSafe(uint256 _safeTokensToSell) external returns (uint256);

    /**
    *   @notice calculate the amount of SAFE needed to swap to get the exact USD amount, SAFE is burned USD redeemed from the vault
    *   @param _usdToGet number of tokens to buy, the respective amount of stable coin  will be deducted from the user, Safe Yield token will be minted
    */
    function sellSafeForExactAmountOfUSD(uint256 _usdToGet) external;

    /**
    *   @notice admin function, currently used only to deposit 1 SAFE token to the Safe Vault to set the start price
    */
    function mint(address usr, uint256 wad) external;

    /**
    *   @notice admin function
    */
    function burn(address usr, uint256 wad) external;

    /**
    *   @notice list of wallets participating in tax distribution on top of the vault
    */
    function getWallets() external view returns (address[2] memory);

    /**
    *   @notice stable coin token contract used in the protocol
    */
    function usd() external view returns (IERC20);

    /**
*   @notice attached safe vault contract
    */
    function safeVault() external view returns (ISafeVault);

    /**
    *   @notice price of 1 Safe Yield token in StableCoin
    */
    function price() external view returns (uint256);
}

contracts/interfaces/ISafeVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.17;

/// @title  ISafeVault
/// @author crypt0grapher
/// @notice Safe Yield Vault depositing to the third-party yield farms
interface ISafeVault {
    event Deposit(address indexed user, uint256 amount);
    event Withdraw(address indexed user, uint256 amount);

    // @notice deposit stable coin  to the vault from the sender, anyone can deposit funds to the vault
    // @param _amount amount of stable coin  to deposit
    function deposit(uint256 _amount) external;

    // @notice Withdraw stable coin from the vault, supported only for the SafeToken currently on selling SAFE Token
    // @dev that's called remove specifically to avoid confusion with withdraw since the vault is not a pool and can't be withdrawn from except the safe token
    // @param _user user to send tokens to, withdrawn from the sender
    // @param _amount amount of stable coin  to withdraw
    function remove(address _user, uint256 _amount) external;

    // @notice totalSupply of the vault, total amount of the stablecoin in the vault, including deposits and other tokens transferred to the vault
    // @return total supply of the vault
    function totalSupply() external view returns (uint256);

    // @notice total deposited of the vault from non-Safe Token "external" users
    // @return total stable coin deposited to the vault
    function deposited() external view returns (uint256);

}

contracts/SafeRouter.sol.content:
/// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "hardhat/console.sol";

import "hardhat-deploy/solc_0.8/proxy/Proxied.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./interfaces/ISafeToken.sol";

contract SafeRouter is Proxied, ReentrancyGuard {
    address public kyberSwapRouterContract;
    ISafeToken public safeTokenContract;
    bytes4 public constant swap = 0xe21fd0e9;
    bytes4 public constant swapSimpleMode = 0x8af033fb;
    IERC20 public usd;


    function initialize(address _kyberSwapRouter, address _usd, address _safeToken) public proxied {
        kyberSwapRouterContract = _kyberSwapRouter;
        usd = IERC20(_usd);
        safeTokenContract = ISafeToken(_safeToken);
        usd.approve(address(safeTokenContract), type(uint256).max);
        safeTokenContract.approve(address(safeTokenContract), type(uint256).max);

    }

    constructor(address _kyberSwapRouter, address _usd, address _safeToken) {
        initialize(_kyberSwapRouter, _usd, _safeToken);
    }

    function approveTokens(
        address[] calldata tokens,
        address spender,
        uint256 amount
    ) external onlyProxyAdmin {
        uint256 tokenCount = tokens.length;
        for (uint256 i = 0; i < tokenCount; i++) {
            IERC20 token = IERC20(tokens[i]);
            bool success = token.approve(spender, amount);
            require(success, "Token approval failed");
        }
    }

    function updateAllowedContract(address _allowedContract) external {
        require(msg.sender == tx.origin, "Only EOA can update the allowed contract");
        kyberSwapRouterContract = _allowedContract;
    }


    function proxyAndBuy(bytes calldata data) external nonReentrant {
        bytes4 functionSignature = extractFunctionSignature(data);
        require(functionSignature == swap || functionSignature == swapSimpleMode, "Not allowed function");
        (bool success, bytes memory returnData) = kyberSwapRouterContract.call(data);
        if (!success) {
            assembly {
                let returnDataSize := mload(returnData)
                revert(add(32, returnData), returnDataSize)
            }
        } else {
            (uint256 returnAmount, uint256 gasUsed) = abi.decode(returnData, (uint256, uint256));
            uint safeTokensToBuy = safeTokenContract.buySafeForExactAmountOfUSD(returnAmount);
            safeTokenContract.transfer(msg.sender, safeTokensToBuy);
        }
    }

    function sellAndProxy(bytes calldata data, uint256 safeAmount) external nonReentrant {
        bytes4 functionSignature = extractFunctionSignature(data);
        require(functionSignature == swap || functionSignature == swapSimpleMode, "Not allowed function");
        uint currentUSD = usd.balanceOf(address(this));
        uint usdToReturn = safeTokenContract.sellExactAmountOfSafe(safeAmount);
        (bool success, bytes memory returnData) = kyberSwapRouterContract.delegatecall(data);
        require(success, "KyberSwap execution failed");
        (uint256 returnAmount, uint256 gasUsed) = abi.decode(returnData, (uint256, uint256));
        uint remainingUsd = usd.balanceOf(address(this));
        if (remainingUsd > currentUSD) {
            usd.transfer(msg.sender, remainingUsd - currentUSD);
        }
    }

    function extractFunctionSignature(bytes memory data) internal pure returns (bytes4) {
        require(data.length >= 4, "Invalid data length");
        bytes4 signature;
        assembly {
            signature := mload(add(data, 32))
        }
        return signature;
    }
}

contracts/SafeToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.17;

import "./interfaces/ISafeToken.sol";
import "./interfaces/ISafeVault.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "hardhat-deploy/solc_0.8/proxy/Proxied.sol";
import "./Wallets.sol";
import "hardhat/console.sol";

/// @title  SafeToken
/// @author crypt0grapher
/// @notice This contract is used as a token for the SafeYields protocol
contract SafeToken is ISafeToken, Wallets, Proxied, Pausable, ReentrancyGuard {
    // @notice ERC20 token data
    string public constant name = "Safe Yields Token";
    string public constant symbol = "SAFE";
    string public constant version = "1";
    uint8 public constant decimals = 6;

    /// @notice Total supply of the token, the ratio of totalSupply of the vault by the totalSupply of the Safe Token defines the price of the token
    uint256 public totalSupply;

    /// @notice Whitelisted addresses for transfers, contains protocol contracts and selected partners
    /// @dev if not included into the list, transfer is prohibited
    mapping(address => bool) public whitelist;

    // @notice Balances of each user
    mapping(address => uint256) public balanceOf;

    // @notice Approved allowances
    mapping(address => mapping(address => uint256)) public allowance;

    // @notice Taxes, multiplied by 10000, (25 stands for 0.25%)
    uint256 public BUY_TAX_PERCENT;
    uint256 public SELL_TAX_PERCENT;

    // @notice core protocol addresses
    IERC20 public usd;
    ISafeVault public safeVault;

    // @notice tax distribution percentages, multiplied by 10000, (25 stands for 0.25%)
    uint256[WALLETS] public taxDistributionOnMintAndBurn;

    /* ============ Changing State Functions ============ */

    /// @dev this one is called by the proxy
    function initialize(address _usdToken, address _safeVault, address[WALLETS] memory _wallets, uint256[WALLETS] memory _taxDistributionOnMintAndBurn, uint256 _buyTaxPercent, uint256 _sellTaxPercent) public proxied {
        whitelist[_msgSender()] = true;
        safeVault = ISafeVault(_safeVault);
        usd = IERC20(_usdToken);
        _setWallets(_wallets);
        taxDistributionOnMintAndBurn = _taxDistributionOnMintAndBurn;
        BUY_TAX_PERCENT = _buyTaxPercent;
        SELL_TAX_PERCENT = _sellTaxPercent;
        usd.approve(address(safeVault), type(uint256).max);
    }

    constructor(address _usdToken, address _safeVault, address[WALLETS] memory _wallets, uint256[WALLETS] memory _taxDistributionOnMintAndBurn, uint256 _buyTaxPercent, uint256 _sellTaxPercent )  {
        initialize(_usdToken, _safeVault, _wallets, _taxDistributionOnMintAndBurn, _buyTaxPercent, _sellTaxPercent);
    }

    function transfer(address dst, uint256 amt) external returns (bool) {
        return transferFrom(_msgSender(), dst, amt);
    }

    function getWallets() external view returns (address[WALLETS] memory) {
        return wallets;
    }

    function transferFrom(
        address src,
        address dst,
        uint256 amt
    ) public nonReentrant returns (bool) {
        address sender = _msgSender();
        address admin = _proxyAdmin();
        require(!paused(), "SafeToken:paused");
        require(whitelist[src] == true || whitelist[dst] == true || admin == sender, "SafeToken: transfer-prohibited");
        require(balanceOf[src] >= amt, "SafeToken:insufficient-balance");
        require(dst != address(0) && src != address(0), "SafeToken:zero-address");
        if (src != sender && sender != admin) {
            require(allowance[src][sender] >= amt, "SafeToken:insufficient-allowance");
            allowance[src][sender] -= amt;
        }
        balanceOf[src] -= amt;
        balanceOf[dst] += amt;
        emit Transfer(src, dst, amt);
        return true;
    }


    function mint(address _user, uint256 _amount) external onlyProxyAdmin {
        _mint(_user, _amount);
    }

    function burn(address _user, uint256 _amount) external onlyProxyAdmin {
        _burn(_user, _amount);
    }


    function buySafeForExactAmountOfUSD(uint256 _usdToSpend) public nonReentrant returns (uint256) {
        console.log("_msgSender()", _msgSender());
        console.log("address(this)", address(this));
        require(_usdToSpend > 0, "SafeToken: amount must be greater than 0");
        uint256 usdTax = _usdToSpend * BUY_TAX_PERCENT / HUNDRED_PERCENT;
        uint256 usdToSwapForSafe = _usdToSpend - usdTax;
        uint256 safeTokensToBuy = (usdToSwapForSafe * 1e6) / price();
        _mint(_msgSender(), safeTokensToBuy);
        bool success = usd.transferFrom(_msgSender(), address(this), _usdToSpend);
        // that's for compatibility, usually if the transfer fails, it reverts but that's not the obligation of ERC20
        require(success, "SafeToken:transfer-failed");
        // distributing to wallets (if any, currently it's treasury and management)
        // it's not 100% in total, although could be the case
        uint256 paid = _distribute(usd, usdTax, taxDistributionOnMintAndBurn);
        safeVault.deposit(usdToSwapForSafe + usdTax - paid);
        return safeTokensToBuy;
    }

    function buyExactAmountOfSafe(uint256 _safeTokensToBuy) public nonReentrant {
        require(_safeTokensToBuy > 0, "SafeToken: amount must be greater than 0");
        uint256 usdPriceOfTokensToBuy = _safeTokensToBuy * price() / 1e6;
        uint256 usdTax = usdPriceOfTokensToBuy * BUY_TAX_PERCENT / HUNDRED_PERCENT;
        uint256 usdToSpend = usdPriceOfTokensToBuy + usdTax;
        _mint(_msgSender(), _safeTokensToBuy);
        bool success = usd.transferFrom(_msgSender(), address(this), usdToSpend);
        require(success, "SafeToken:transfer-failed");
        uint256 paid = _distribute(usd, usdTax, taxDistributionOnMintAndBurn);
        if (usdToSpend - paid > 0) {
            safeVault.deposit(usdToSpend - paid);
        }
    }


    function sellExactAmountOfSafe(uint256 _safeTokensToSell) public nonReentrant returns (uint256) {
        require(_safeTokensToSell > 0, "SafeToken: amount must be greater than 0");
        uint256 usdPriceOfTokensToSell = _safeTokensToSell * price() / 1e6;
        uint256 usdTax = usdPriceOfTokensToSell * SELL_TAX_PERCENT / HUNDRED_PERCENT;
        uint256 usdToReturn = usdPriceOfTokensToSell - usdTax;
        console.log('_msgSender()', _msgSender());
        console.log('msg.sender', msg.sender);
        _burn(_msgSender(), _safeTokensToSell);
        safeVault.remove(_msgSender(), usdToReturn);
        safeVault.remove(address(this), usdTax);
        uint256 paid = _distribute(usd, usdTax, taxDistributionOnMintAndBurn);
        if (usdTax - paid > 0) {
            safeVault.deposit(usdTax - paid);
        }
        return usdToReturn;
    }

    function sellSafeForExactAmountOfUSD(uint256 _usdToPayToUser) public nonReentrant {
        require(_usdToPayToUser > 0, "SafeToken: amount must be greater than 0");
        uint256 usdTax = _usdToPayToUser * SELL_TAX_PERCENT / HUNDRED_PERCENT;
        uint256 usdPriceWithTax = _usdToPayToUser + usdTax;
        uint256 safeTokensToBurn = (usdPriceWithTax * 1e6) / price();
        _burn(_msgSender(), safeTokensToBurn);
        safeVault.remove(_msgSender(), _usdToPayToUser);
        safeVault.remove(address(this), usdTax);
        uint256 paid = _distribute(usd, usdTax, taxDistributionOnMintAndBurn);
        if (usdTax - paid > 0)
            safeVault.deposit(usdTax - paid);
    }

    function approve(address usr, uint256 amt) external returns (bool) {
        allowance[_msgSender()][usr] = amt;
        emit Approval(_msgSender(), usr, amt);
        return true;
    }

    function whitelistAdd(address guy) external onlyProxyAdmin {
        whitelist[guy] = true;
    }

    function whiteListRemove(address guy) external onlyProxyAdmin {
        whitelist[guy] = false;
    }

    function pause() external onlyProxyAdmin {
        _pause();
    }

    function unpause() external onlyProxyAdmin {
        _unpause();
    }

    /* ============ View Functions ============ */

    /// @dev this is intentional that not deposited() is used, because the total amount of USD in the vault is used to calculate the price
    function getUsdReserves() public view returns (uint256) {
        return safeVault.totalSupply();
    }

    /// @dev the key is the price is usd reserves, so not only user deposits from safe purchase, but also injections from the NFT purchase and treasury if needed
    function price() public view returns (uint256) {
        return (totalSupply == 0) ? 1e6 : getUsdReserves() * 1e6 / totalSupply;
    }

    /* ============ Internal Functions ============ */

    function _mint(address usr, uint256 amount) internal {
        balanceOf[usr] += amount;
        totalSupply += amount;
        emit Transfer(address(0), usr, amount);
    }

    function _burn(address usr, uint256 amount) internal {
        require(balanceOf[usr] >= amount, "SafeToken:insufficient-balance");
        address sender = _msgSender();
        if (_proxyAdmin() != sender && usr != sender && allowance[usr][sender] != type(uint256).max) {
            require(allowance[usr][sender] >= amount, "SafeToken:insufficient-allowance");
            allowance[usr][sender] -= amount;
        }
        balanceOf[usr] -= amount;
        totalSupply -= amount;
        emit Transfer(usr, address(0), amount);
    }

}

